Новое мобильное приложение «Шоколадницы» — это единая программа лояльности для всех заведений сети. С его помощью вы сможете без труда найти ближайшее кафе, узнать о действующих акциях и специальных предложениях.

Что дает участие в программе лояльности:

- бонусы за каждый заказ, которыми можно оплачивать следующие покупки (до 50% от суммы чека);
- кэшбек 10%;
- кофе (размера S) в подарок после первой покупки;
- 200 бонусов в подарок за 5 дней до дня рождения;
- «штампики»: каждый 10-й кофе, завтрак, ланч и ужин — бесплатно;
- персональные акции: пуш-уведомления с выгодными предложениями;
- абонементы и подарочные карты, которые можно приобрести в приложении и подарить в электронном виде.

Удобное и максимально простое мобильное приложение  доставки блюд японской и паназиатской кухни - суши, роллы, лапша wok, рис wok, салаты и супы.

«СушиStore» - это вкусная еда, продуманный сервис, современный дизайн, разнообразие акций и выгодных предложений.

Скачайте мобильное приложение «СушиСтор» и сделайте моментальный заказ любимых блюд в несколько касаний.

Служба доставки работает с 10:00 до 23:00, заказы принимаются до 22:30
Минимальная сумма заказа 699 руб.
Среднее время приготовления заказа - 15 минут.
Доставка суши занимает около 60 минут, в зависимости от удаленности адреса доставки от ближайшего суши-бара и загруженности дорог.

Мы честны со своими покупателями, поэтому не включаем расходы на доставку в стоимость суши, доставка оплачивается отдельно - 100 рублей.

Почему доставка Суши Стор лучшее мобильное приложение?
- большой выбор блюд на любой вкус: суши, роллы, сеты, лапша wok, рис wok, салаты и супы;
- возможность сделать предзаказ к удобному для Вас времени;
- отображение статуса заказа в личном кабинете;
- постоянные акции и специальные предложения;
- возможность накопления баллов с каждого заказа;
- личный кабинет, в котором сохраняется история ваших заказов, а также возможность повтора предыдущих заказов.

